import { Navigation, Pagination, Mousewheel, Keyboard } from "swiper";
import { Swiper, SwiperSlide } from "swiper/react";

// Import Swiper styles
// import "swiper/css";
import "swiper/css/navigation";
// import "swiper/css/pagination";

import "./apple.css";

const Level = () => {

    return (
        <div>
            <div className="font-['MaplestoryOTFBold'] text-xl">
                난이도를 선택해 주세요.
            </div>
            <div className="h-[5%]">
                <Swiper
                    cssMode={false}
                    navigation={true}
                    pagination={true}
                    mousewheel={true}
                    keyboard={true}
                    modules={[Navigation, Pagination, Mousewheel, Keyboard]}
                    className="h-[10%] my-5 py-5"
                >
                    <SwiperSlide className="flex bg-transparent justify-center font-['MaplestoryOTFBold'] text-2xl">하</SwiperSlide>
                    <SwiperSlide>중</SwiperSlide>
                    <SwiperSlide>상</SwiperSlide>
                    
                </Swiper>
            </div>
        </div>
    )
}

export default Level;
